import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import Footers from "../components/Footers";
import "../css_styles/DetailProductivity.css";
import ProductivityDetail from "../components/ProductivityDetail";
import { useParams } from "react-router-dom";

import { tourismsDetailAction } from "../actions/advertiseActions2";
import Loaders from "../components/Loader";
import ErrorMessage from "../components/ErrorMessage";

const TourismsDetail = ({ match, history, location }) => {
    const params = useParams();
    const id = params.id;

    const dispatch = useDispatch();
    const tourismsDetail = useSelector((state) => state.tourismsDetail);

    const {
      error:   detailTourismsError,
      loading: detailTourismsLoading,
      tourisms:detailTourisms,
    } = tourismsDetail;

    useEffect(() => {
      dispatch(tourismsDetailAction(id));
    }, [dispatch]);

    return (
      <div>
        <div className="productivity_main">
          <div className="productivity_advertise"></div>
          {detailTourismsLoading ? (
            <Loaders />
          ) : detailTourismsError ? (
            <ErrorMessage type="error" error={detailTourismsError} />
          ) : (
            <div className="productivity_cards">
              <ProductivityDetail tech={detailTourisms} model={"Tourisms"} />
            </div>
          )}
          <div className="productivity_advertise">
            {/* <Advertise tech={techs} /> */}
          </div>
        </div>

        <Footers />
      </div>
    );
  };

export default TourismsDetail;
